import React from "react";

const CareerRoadmap = ({ insights }) => {
  const { roadmap } = insights;

  return (
    <div className="bg-white rounded-lg shadow-md p-6">
      <h2 className="text-2xl font-bold text-purple-600 mb-4">
        Career Development Roadmap
      </h2>
      <div className="space-y-6">
        {roadmap.map((step, index) => (
          <div
            key={index}
            className="flex items-start space-x-4 bg-purple-50 rounded-lg p-4"
          >
            <div className="flex-shrink-0">
              <div className="w-8 h-8 bg-gradient-to-r from-purple-600 to-purple-800 rounded-full flex items-center justify-center text-white font-semibold">
                {index + 1}
              </div>
            </div>
            <div>
              <h3 className="text-lg font-semibold text-purple-800 mb-2">
                {step.title}
              </h3>
              <p className="text-gray-600">{step.description}</p>
              {step.skills && step.skills.length > 0 && (
                <div className="mt-2">
                  <p className="text-sm font-medium text-gray-700 mb-1">
                    Key Skills to Develop:
                  </p>
                  <div className="flex flex-wrap gap-2">
                    {step.skills.map((skill, skillIndex) => (
                      <span
                        key={skillIndex}
                        className="inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium bg-purple-100 text-purple-800"
                      >
                        {skill}
                      </span>
                    ))}
                  </div>
                </div>
              )}
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default CareerRoadmap;
